            <v-container justify-center max-width="440">
              <v-card flat class="mr-8">
                <div>
                  <h1 class="text-subtitle-1 font-weight-bold pb-5">
                    Wintercell
                  </h1>
                  <h1 class="text-h6 font-weight-medium">
                    Set up your company
                  </h1>
                  <p class="text-caption text-blue-grey-darken-3 pb-6">
                    Enter company name. You can invite team members with their
