                  </p>
                </div>
                <v-form v-model="form" @submit.prevent="inviteEmail">
                    <!-- company name entry -->
                  <label for="compName">What’s your company name?</label>
                  <v-text-field
                    v-model="compName"
                    id="compName"
                    variant="outlined"
                    :rules="nameRules"
                    color="blue"
                    placeholder="ACME, Inc."
                    base-color="grey"
                    density="compact"
                  ></v-text-field>
                  <!-- invite members entry-->
                  <label for="invites">Invite members</label>
                  <v-text-field
                    v-for="(invitee, i) in members"
                    :key="i"
                    v-model="invitee.name"
