<script>
export default {
  components: {},
  data() {
    return {
      email: "",
      compName: "",
      members: [{ name: "" }, { name: "" }],
      form: false,
      loading: false,
      emailRules: [
        (value) => {
          if (value && /.+@.+\..+/.test(value)) return true;
          return "";
        },
      ],
      nameRules: [
        (value) => {
          if (value) return true;
          return "";
        },
      ],
    };
  },
  methods: {
    inviteEmail() {
      if (!this.form) return;
      this.loading = true;

      setTimeout(() => {
        this.loading = false;
        // save the details entered and also send an invite link to email addresses entered
      }, 1000);
    },
  },
};
</script>

